import React from 'react';
import styled from 'styled-components';
import Nav from "../../components/Nav";


const MyPage = () => {
  const projects = [    { id: 1, author: '전상연', title: '재난 대응 어플리케이션 백엔드 구해요!', tags: ['AWS', 'BlockChain', 'Python'], hearts: 12 },
    // 추가 프로젝트를 여기에 추가
  ];
  const isLoggedIn = true; 
  const showSearch = false;

  return (
    <Container>
      <Nav isLoggedIn={isLoggedIn} showSearch={showSearch}/>

      <List>
      <ul>
            <li><a href="#">신청 목록</a></li>
            <li><a href="#">관심 목록</a></li>
            <li><a href="#">작성 목록</a></li>
            <li><a href="#">임시 저장</a></li>
            <li><a href="#">마감 목록</a></li>
            <li><a href="#">개인 정보</a></li>
          </ul>
      </List>
      <ProjectList>
        {projects.map(project => (
          <ProjectItem key={project.id}>
            <ProjectHeader>
              <span>{project.author}</span>
              <span>❤️ {project.hearts}</span>
            </ProjectHeader>
            <p>{project.title}</p>
            <Tags>
              {project.tags.map((tag, index) => (
                <span key={index}>{tag}</span>
              ))}
            </Tags>
            <Button>모집 진행중</Button>
          </ProjectItem>
        ))}
      </ProjectList>
    </Container>
  );
};

export default MyPage;

const Container = styled.div`
margin-top: calc(100vh - 38%);
 min-height: calc(100vh - 250px);
 display: flex;
//  margin-top:30px;
padding-top: 30px;
 flex-direction: column;
 align-items: center;
`;

const Header = styled.header`
  background-color: #f8f9fa;
  padding: 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;



const List = styled.div`
  background-color: #f8f9fa;
  padding: 20px;
  display: flex;
  justify-content: space-between;
  align-items: center;

  ul {
    list-style: none;
    display: flex;
    gap: 20px;
  }

  a {

    border-radius: 5px;
    padding: 5px 20px;
    margin-right:20px;
    border: 1px solid ;
    border-radius: 15px 15px 1px 15px; //반시계 ㅔ방향
    box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
    border-color: rgba(160, 218, 251);
    background-color: white;
    color: #0A8ED9 ;
  }
`;



const ProjectList = styled.div`
  padding: 20px;
`;

const ProjectItem = styled.div`
  border: 1px solid #e0e0e0;
  border-radius: 8px;
  padding: 15px;
  margin-bottom: 15px;
`;

const ProjectHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Tags = styled.div`
  margin: 10px 0;

  span {
    background-color: #e0e0e0;
    border-radius: 4px;
    padding: 5px;
    margin-right: 5px;
  }
`;

const Button = styled.button`
  background-color: #007bff;
  color: white;
  border: none;
  padding: 10px 15px;
  border-radius: 5px;
  cursor: pointer;
`;
